



update ft_T_incl a set prnt_clsf_oid=(select b.clsf_oid from ft_T_incl b where level_num=3 and b.cl_value=substring(a.cl_value,1,6) and b.indus_cl_set_id ='GICS' limit 1) where level_num=4 and indus_cl_set_id ='GICS' and a.prnt_clsf_oid is null;
update ft_T_incl a set prnt_clsf_oid=(select b.clsf_oid from ft_T_incl b where level_num=2 and b.cl_value=substring(a.cl_value,1,4) and b.indus_cl_set_id ='GICS' limit 1) where level_num=3 and indus_cl_set_id ='GICS' and a.prnt_clsf_oid is null;
update ft_T_incl a set prnt_clsf_oid=(select b.clsf_oid from ft_T_incl b where level_num=1 and b.cl_value=substring(a.cl_value,1,2) and b.indus_cl_set_id ='GICS' limit 1) where level_num=2 and indus_cl_set_id ='GICS' and a.prnt_clsf_oid is null;


commit;